import React from "react";
const ContentModule04 = () => (
  <div className="contmodule contmodule-02 col-sm-12 col-md-6 col-lg-4">
    <a href="#">
      <div
        className="contmodule-image"
        style={{
          backgroundImage: 'url("/static/assets/content-image.jpg")'
        }}
      ></div>

      <h5 className="contmodule-title">UN Summit 2019</h5>
      <p className="contmodule-text">25 - 27 September 2019</p>
    </a>
  </div>
);

export default ContentModule04;
